import React, { useState } from "react";
import {
    Card,
    CardHeader,
    CardBody,
    Container,
    Row,
    Col,
    Button,
    Form,
    FormGroup,
    Label,
    Input,
} from "reactstrap";
import { useNavigate } from "react-router-dom";
import Header from "components/Headers/Header.js";

const AddMedicineTypes = () => {
    const navigate = useNavigate();
    const [medicineType, setMedicineType] = useState({
        code: "",
        name: "",
    });

    // Handle input changes
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setMedicineType({ ...medicineType, [name]: value });
    };

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        // Here you would typically send the data to a backend
        console.log("Medicine Type Submitted:", medicineType);

        // Navigate back to medicine types list
        navigate("/admin/medicine-types");
    };

    // Handle cancel and return to list
    const handleCancel = () => {
        navigate("/admin/medicine-types");
    };

    return (
        <>
            <Header />
            <Container className="mt--7" fluid>
                <Row className="justify-content-center">
                    <Col lg="8">
                        <Card className="bg-secondary shadow">
                            <CardHeader className="bg-white border-0">
                                <Row className="align-items-center">
                                    <Col xs="8">
                                        <h3 className="mb-0">Quản Lý Loại Thuốc / Thêm Loại Thuốc</h3>
                                    </Col>
                                </Row>
                            </CardHeader>
                            <CardBody>
                                <Form onSubmit={handleSubmit}>
                                    <div className="pl-lg-4">
                                        <Row>
                                            <Col lg="12">
                                                <FormGroup>
                                                    <Label>Mã Loại Thuốc</Label>
                                                    <Input
                                                        className="form-control-alternative"
                                                        name="code"
                                                        placeholder="Nhập mã loại thuốc"
                                                        type="text"
                                                        value={medicineType.code}
                                                        onChange={handleInputChange}
                                                        required
                                                    />
                                                </FormGroup>
                                            </Col>
                                        </Row>
                                        <Row>
                                            <Col lg="12">
                                                <FormGroup>
                                                    <Label>Tên Loại Thuốc</Label>
                                                    <Input
                                                        className="form-control-alternative"
                                                        name="name"
                                                        placeholder="Nhập tên loại thuốc"
                                                        type="text"
                                                        value={medicineType.name}
                                                        onChange={handleInputChange}
                                                        required
                                                    />
                                                </FormGroup>
                                            </Col>
                                        </Row>
                                        <Row>
                                            <Col>
                                                <div className="text-right">
                                                    <Button
                                                        color="secondary"
                                                        onClick={handleCancel}
                                                        type="button"
                                                    >
                                                        Quay Lại
                                                    </Button>
                                                    <Button
                                                        color="primary"
                                                        type="submit"
                                                        className="ml-2"
                                                    >
                                                        Lưu Lại
                                                    </Button>
                                                </div>
                                            </Col>
                                        </Row>
                                    </div>
                                </Form>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default AddMedicineTypes;
